import React from 'react';

export class ClientOnGoingTable extends React.Component
{
    constructor(props) {
        super(props) //since we are extending class Table so we have to use super in order to override Component class constructor
        this.state = { //state is by default an object
            cases: [
                { id: 1, caseTitle: 'Chest pain and arm hurts', Doctor: 'Maria Anders', category: 'Cardiology', createDate: '08/17/20', status: 'pending'},
                { id: 2, caseTitle: 'runny nose and itchy throat', Doctor: 'Christina Berglund.', category: 'Cardiology', createDate: '08/27/20', status: 'Diagnosing'},
                { id: 3, caseTitle: 'cried after watching Encino Man', Doctor: 'Francisco Chang', category: 'Cardiology', createDate: '08/27/20', status: 'Diagnosing'},
                { id: 4, caseTitle: 'path_kev11741_01', Doctor: 'Maria Anders, M.D.', category: 'Pathology', createDate: '08/29/20', status: 'pending'},
            ]
        }
    }

    renderTableData() {
        return this.state.cases.map((student, index) => {
            const { id, name, age, email } = student //destructuring
            return (
                <tr key={id}>
                    <td>{id}</td>
                    <td>{name}</td>
                    <td>{age}</td>
                    <td>{email}</td>
                </tr>
            )
        })
    }

    render()
    {
        return(
            <div>
                <h1 id='title'>React Dynamic Table</h1>
                <table id='students'>
                    <tbody>
                    {this.renderTableData()}
                    </tbody>
                </table>
            </div>
        );
    }
}
